import React, { useState } from 'react';
import './App.css';

function App() {

  const [todoText, setTodoText] = useState();
  const [incompleteTodos, setIncompleteTodos] = useState(["uma1", "uma2", "uma1", "uma2"]);
  const [completeTodos, setCompleteTodos] = useState(["uma1", "uma2", "uma1", "uma2"]);


  return (
    <div className='App'>
      <section><p>競走馬リスト</p></section>
      <div className='formArea'>
        <form>
          <input type="text" className='umaName' />
          <input type="submit" value="＋" className='umaButton' />
        </form>
      </div>
      <div className='IncompleteArea'>
        <p className='title'>まだ撮ってない馬</p>
        <ul>
          {incompleteTodos.map((todo) => {
            return (
              <li><p>{todo}</p>
                <button>完了</button>
                <button>削除</button></li>
            )
          })}

        </ul>
      </div>
      <div className='CompleteArea'>
        <p className='title'>もう撮った馬</p>
        <ul>
          <li><p>リバティアイランド</p>
            <button>戻す</button></li>
        </ul>
      </div>
    </div>
  )
}

export default App;
